import React from 'react';
import { Col, Row, Button, Form } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';

const ChatPage = () => {
    return(
        <>
            <Col>
                <Row>
                    <Box style={{width: "500px", height: "450px"}} text="PT Video" />
                    <Col></Col>
                    <Col>
                        <Box style={{width: "500px", height: "500px"}} text="Chat"/>
                    </Col>
                    <Box style={{width: "500px", height: "450px"}} text="Patient Video" />
                </Row>
                <br></br>
            </Col>
        </>
    );
}

export default ChatPage;
